import React, { Component } from "react";

export class Ac extends Component {
  constructor() {
    super();
  }
  render() {
    return (
      <div>
        <button onClick={this.props.handleToggleVisibility}>
          {this.props.visibility ? "Hide details" : "Show details"}
        </button>
      </div>
    );
  }
}

export default Ac;
